window.bookSummaryJSON = "<p>Naomi Winters will be 40 soonish, and she’s only been with one man. One night. One time. Long ago. She believes everything happens for a reason, and the universe spoke about Nathan Ryder.</p> <p>Nathan Ryder isn’t the same man who hightailed his bike out of Green Valley, 18 years ago. As a rule breaker, women are one area he acts a fool. Case in point, the local librarian. He can’t get a read on her, but she’s one risk he’s willing to take. Again.</p> <p>What do an eccentric librarian and a sexy silver biker have in common? </p> <p>More than you think. The due date on their love might not be expired, after all.</p> <p><b><i>Love in Due Time</i></b><b> is a full-length, contemporary romantic comedy that can be listened to as a stand-alone, and is book one in the Green Valley Library series.</b></p>"; 
